        alignItems: "center",
        height: "15%"
      },


      container_nomes:{
        width: "100%",
        height: "100%",
        flexDirection: "row",
      },

      container_nomes_img:{
        width: "27%",
      },

      container_nomes_inf:{
        width: "73%",
        flex: 1,
        flexDirection: "column",
        marginLeft: 8,
      },

      container_nomes_symbol:{
        width: "100%",
        height: "60%",
        justifyContent: "center",
        
      },

      symbol:{
        fontSize: 50,
        color: "#A6ACBB"
      },

      container_nomes_shortName:{
        width: "100%",
        height: "40%",
        justifyContent: "center",
        textAlign: "justify"
      },

      shortName:{
        color: "#A6ACBB"
      },
      


   })
export default styles
